static double bilinear_interp(float const data[ROWS][COLS], int x0, int y0, double fx, double fy) {
    double v00 = data[y0][x0];
    double v10 = data[y0][x0 + 1];
    double v01 = data[y0 + 1][x0];
    double v11 = data[y0 + 1][x0 + 1];
    return v00 * (1.0 - fx) * (1.0 - fy) + v10 * fx * (1.0 - fy) + v01 * (1.0 - fx) * fy +
           v11 * fx * fy;
}

Enu<> lookup(Llh<> const& position) {
    double lon = position.longitude_deg();
    double lat = position.latitude_deg();
    double x   = (lon - ORIGIN_LON) / PIXEL_WIDTH;
    double y   = (lat - ORIGIN_LAT) / PIXEL_HEIGHT;
    if (x < 0.0 || x >= COLS - 1 || y < 0.0 || y >= ROWS - 1) {
        return Enu<>{Vector3d::Zero()};
    }
    int    x0 = static_cast<int>(x);
    int    y0 = static_cast<int>(y);
    double fx = x - x0;
    double fy = y - y0;
    double e  = bilinear_interp(EAST_DATA, x0, y0, fx, fy) * 0.001;
    double n  = bilinear_interp(NORTH_DATA, x0, y0, fx, fy) * 0.001;
    double u  = bilinear_interp(UP_DATA, x0, y0, fx, fy) * 0.001;
    return Enu<>{Vector3d(e, n, u)};
}

